pragma solidity ^0.5.2;

import "./User.sol"; 
import "./CloneFactory.sol";

contract UserFactory is CloneFactory {
    address cloneUser;

    constructor() public {
        cloneUser = address(new User());
    }

    function createUser(address _creator, bytes32 _username) external returns(address) {
        address clone = createClone(cloneUser);
        User(clone).initialize(msg.sender, _creator, _username);
        return clone;
    }
}
